import React from 'react';
import '../styles/App.css';

function App() {
  return (
    <>
      <div>
        I'm the App component.
      </div>
      <div>
        I will consume other components that make up this application, such as a VoterRegistration
        component or a AvailablePolls component.
      </div>
    </>
  );
}

export default App;
